import logo from './logo.svg';
import './App.css';

import { 
  BrowserRouter as Router,
  Routes,
  Route,
  Navigate,
  Link,
 } from 'react-router-dom';

 import TheMansion from "./pages/TheMansion.html";

function App() {
  return (
    <>
    <Router>
      <Route exact path ="/themansion" render={() => {window.location.href="themansion.html"}} />
    </Router>
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
    </>
  );
}

export default App;
